import React, { useEffect, useState } from 'react'
import axios from 'axios';
// import { SlLike } from "react-icons/sl";
import { useNavigate } from 'react-router-dom';
import AdminNavbar from './AdminNavbar';
import './Adminuserliststyle.css'
import Table from 'react-bootstrap/Table';


function Adminuserlist() {
    const [data, setData] = useState([])
    
    const viewallfn=()=>{
        axios.post("http://127.0.0.1:8080/findalluser")
        .then((result)=>{
            console.log(result)
            setData(result.data.data)
        })
        .catch((error)=>{
            console.log(error)
        })
        
    }

    const nvar=useNavigate()

    const viewoneuser=(id)=>{
        // axios.post("http://127.0.0.1:8080/viewuser/:id",data)
        nvar("/userprofile/"+id);
        // .then((result)=>{
        //     console.log(result)
        //     setData(result.data.data)
        // })
        // .catch((error)=>{
        //     console.log(error)
        // })
    }
    // const updateuser=(id)=>{
    //     axios.post("http://127.0.0.1:8080/updateuser/",id)
    //     .then((result)=>{
    //         console.log(result)
    //         setData(result.data.data)
    //     })
    //     .catch((error)=>{
    //         console.log(error)
    //     })
    // }
    const deleteuser=(id)=>{
        axios.post("http://127.0.0.1:8080/deleteuser/"+id)
        .then((result)=>{
            console.log(result)  
            alert("User deleted successfully")  
            viewallfn();       
        })
        .catch((error)=>{
            console.log(error)
        })
    }

    // const likeuser=(id)=>{
    //     console.log(id)
    //     axios.post("http://127.0.0.1:8080/likeuser/"+id)
    //     .then((result)=>{
    //         console.log(result)            
    //     })
    //     .catch((error)=>{
    //         console.log(error)
    //     })
    // }
    
    useEffect(()=>{
        viewallfn();
    },[])
  return (
    <div>
        <div className='adminhome'>
              <AdminNavbar/>
        
        </div>

        <div className='container'>
        <div className="adminuserlist">
        <center>    
                <h2 id='adminuserlistheading'>User List</h2><br/>
                <div>                    
                      <Table border={1}>
                          <thead>
                              <tr>
                                  <th className='adminusertablelabel'>Sl.No</th>
                                  <th className='adminusertablelabel'>Image</th>
                                  <th className='adminusertablelabel'>Name </th>
                                  <th className='adminusertablelabel'>Type of Employement</th>
                                  <th className='adminusertablelabel'>Age</th>
                                  <th className='adminusertablelabel'>Employee ID</th>
                                  <th className='adminusertablelabel'>Email</th>
                                  <th className='adminusertablelabel'>Password</th>
                                  <th className='adminusertablelabel'>Options</th>
                              </tr>
                          </thead>

                        {
                            data.length > 0 ?
                            data.map((item, index)=>(
                                <tbody key={index}>
                                    <tr>
                                        <td>{index + 1}</td>
                                        <td></td>
                                        <td>{item.empname}</td>
                                        <td>{item.typeofemp}</td>
                                        <td>{item.age}</td>
                                        <td>{item.empid}</td>
                                        <td>{item.email}</td>
                                        <td>{item.password}</td>
                                        <td><button onClick={()=>{viewoneuser(item._id)}}>View</button>&nbsp;
                                        <button onClick={()=>{deleteuser(item._id)}}>Delete</button>&nbsp;
                                        {/* <button onClick={()=>{likeuser(item._id)}}><SlLike /> */}
                                        {/* Like</button> */}
                                        </td>
                                    </tr>
                                </tbody>
                            )):<h3>No data found</h3>
                        }   
                      </Table>

                </div>
            </center>
        </div>
        </div>
    </div>
  )
}

export default Adminuserlist
